import React from "react";
import { DrawerActions } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { StackParamList, StackProps } from "./Stack.typeDefs";
import { RegisterFormHeaderLeft, StackHeaderLeft } from "./components";
import { colors } from "@/theme";

import Details from "@/views/Details";
import Profile from "@/views/Profile";
import Register from "@/auth/register/Register";
import RegisterProfileForm from "@/auth/register/registerProfile/RegisterProfileForm";
import FourStepForm from "@/auth/register/registerProfile/FourStepForm";
import { Ionicons } from "@expo/vector-icons";
import { Text, View } from "react-native";
import RegisterSuccess from "@/auth/register/registerProfile/RegisterSuccess";
import { useSelector } from "react-redux";
import { RootState } from "@/redux/store";
import HomeScreen from "@/homescreen/HomeScreen";
import LoginScreen from "@/auth/login/LoginScreen";
import FaceIDScreen from "@/auth/login/FaceIdScreen";
import NotificationsScreen from "@/auth/login/NotificationsScreen";
import BiometricsScreen from "@/auth/login/BiometricsScreen";
import Home from "@/homescreen/Home";
import LeftHeaderLogo from "./components/LeftHeaderLogo";
import RightHeaderNotification from "./components/RightHeaderNotification";
import TabNavigator from "../tab/Tab";
import ForgetPasswordScreen from "@/auth/forgot/ForgetPasswordScreen";
import VerificationScreen from "@/auth/forgot/VerificationScreen";
import NewPasswordScreen from "@/auth/forgot/NewPasswordScreen";
import PasswordUpdateSuccess from "@/auth/forgot/PasswordUpdateSuccess";
import AllocatedUnits from "@/AllocatedUnits/AllocatedUnits";
import RighterHeaderRequest from "./components/RighterHeaderRequest";
import ProjectDetails from "@/AllocatedUnits/ProjectDetails";
import ProjectFilter from "@/components/filter/ProjectFilter";
import HeaderTitleWithSubtitle from "./components/HeaderTitleWithSubtitle";
import FirmUnits from "@/FirmUnits/FirmUnits";
import FirmUnitsDetail from "@/FirmUnits/FirmUnitsDetail";
import WorkSheetDetails from "@/FirmUnits/WorkSheetDetails";

const Stack = createNativeStackNavigator<StackParamList>();

const navigationProps = {
  headerTintColor: colors.white,
  headerStyle: { backgroundColor: colors.primary },
  headerTitleStyle: { fontSize: 16 },
};

export function HomeStackScreen() {
  return (
    <Stack.Navigator screenOptions={navigationProps}>
      <Stack.Screen
        name="Home"
        component={Home}
        options={({ navigation }) => ({
          title: "",
          headerLeft: () => <LeftHeaderLogo navigation={navigation} />,
          headerRight: () => (
            <RightHeaderNotification navigation={navigation} />
          ),
          headerTitleAlign: "center",
          headerShown: true, // Ensure this doesn't override stack-specific headers
        })}
      />
      <Stack.Screen
        name="AllocatedUnits"
        component={AllocatedUnits}
        options={({ navigation }) => ({
          title: "Allocated Units",
          headerLeft: () => <RegisterFormHeaderLeft navigation={navigation} />,
          headerRight: () => <RighterHeaderRequest navigation={navigation} />,
          headerTitleAlign: "center",
          headerShown: true,
        })}
      />

      <Stack.Screen
        name="FirmUnits"
        component={FirmUnits}
        options={({ navigation }) => ({
          title: "Firm Units",
          headerLeft: () => <RegisterFormHeaderLeft navigation={navigation} />,
          headerRight: () => <RighterHeaderRequest navigation={navigation} />,
          headerTitleAlign: "center",
          headerShown: true,
        })}
      />
    </Stack.Navigator>
  );
}

export function HomeStackNavigator() {
  return (
    <Stack.Navigator
      initialRouteName="HomeScreen"
      screenOptions={navigationProps}
    >
      <Stack.Screen
        name="HomeScreen"
        component={TabNavigator}
        options={({ navigation }) => ({
          title: "",
          headerLeft: () => <LeftHeaderLogo navigation={navigation} />,
          headerRight: () => (
            <RightHeaderNotification navigation={navigation} />
          ),
          headerTitleAlign: "center",
          headerShown: false,
        })}
      />

      <Stack.Screen
        name="ProjectDetails"
        component={ProjectDetails}
        options={({ navigation }) => ({
          title: "Bravo",
          headerLeft: () => <RegisterFormHeaderLeft navigation={navigation} />,
          headerRight: () => <RighterHeaderRequest navigation={navigation} />,
          headerTitleAlign: "center",
          headerTitle: () => (
            <HeaderTitleWithSubtitle
              title="Bravo"
              subtitle="Residential"
              subtitleSecondary="Vaughan, ON"
              dotColor="white"
            />
          ),
        })}
      />

      <Stack.Screen
        name="FirmUnitsDetail"
        component={FirmUnitsDetail}
        options={({ navigation }) => ({
          title: "Bravo",
          headerLeft: () => <RegisterFormHeaderLeft navigation={navigation} />,
          headerRight: () => <RighterHeaderRequest navigation={navigation} />,
          headerTitleAlign: "center",
          headerTitle: () => (
            <HeaderTitleWithSubtitle
              title="Bravo"
              subtitle="Residential"
              subtitleSecondary="Toronto, ON"
              dotColor="white" // Customize dot color if needed
            />
          ),
        })}
      />

      <Stack.Screen
        name="ProjectFilter"
        component={ProjectFilter}
        options={({ navigation }) => ({
          headerShown: false,
        })}
      />

      <Stack.Screen
        name="WorkSheetDetails"
        component={WorkSheetDetails}
        options={({ navigation }) => ({
          title: "Firm Units",
          headerLeft: () => <RegisterFormHeaderLeft navigation={navigation} />,
          headerRight: () => <RighterHeaderRequest navigation={navigation} />,
          headerTitleAlign: "center",
          headerShown: true,
        })}
      />
    </Stack.Navigator>
  );
}

export function AuthStackNavigator() {
  const currentStep = useSelector((state: RootState) => state.step.currentStep);
  console.log("ðŸš€ ~ AuthStackNavigator ~ currentStep:", currentStep);
  return (
    <Stack.Navigator screenOptions={navigationProps}>
      <Stack.Screen
        options={{ headerShown: false }}
        component={Register}
        name="RegisterScreen"
      />

      <Stack.Screen
        name="FourStepForm"
        component={FourStepForm}
        options={({ navigation }) => ({
          title: "Register",
          headerLeft: () => <RegisterFormHeaderLeft navigation={navigation} />,
          headerTitleAlign: "center",
        })}
      />

      <Stack.Screen
        name="RegisterSuccess"
        component={RegisterSuccess}
        options={{ headerShown: false }}
      />

      <Stack.Screen
        name="LoginScreen"
        component={LoginScreen}
        options={({ navigation }) => ({
          title: "Log in",
          headerLeft: () => <StackHeaderLeft navigation={navigation} />,
          headerTitleAlign: "center",
        })}
      />

      <Stack.Screen
        name="FaceIdScreen"
        component={FaceIDScreen}
        options={{ headerShown: false }}
      />

      <Stack.Screen
        name="BiometricsScreen"
        component={BiometricsScreen}
        options={{ headerShown: false }}
      />

      <Stack.Screen
        name="NotificationsScreen"
        component={NotificationsScreen}
        options={{ headerShown: false }}
      />

      <Stack.Screen
        name="ForgetPasswordScreen"
        component={ForgetPasswordScreen}
        options={({ navigation }) => ({
          title: "Forgot Password",
          headerLeft: () => <StackHeaderLeft navigation={navigation} />,
          headerTitleAlign: "center",
        })}
      />

      <Stack.Screen
        name="VerificationScreen"
        component={VerificationScreen}
        options={({ navigation }) => ({
          title: "Check your email",
          headerLeft: () => <StackHeaderLeft navigation={navigation} />,
          headerTitleAlign: "center",
        })}
      />

      <Stack.Screen
        name="NewPasswordScreen"
        component={NewPasswordScreen}
        options={({ navigation }) => ({
          title: "Log in",
          headerLeft: () => <StackHeaderLeft navigation={navigation} />,
          headerTitleAlign: "center",
        })}
      />

      <Stack.Screen
        name="PasswordUpdateSuccess"
        component={PasswordUpdateSuccess}
        options={({ navigation }) => ({
          title: "Set new password",
          headerLeft: () => <StackHeaderLeft navigation={navigation} />,
          headerTitleAlign: "center",
        })}
      />
    </Stack.Navigator>
  );
}
